import React from "react";
import Machine from "./Machine";
import './MG.css';

function MG(prop) {
  let mgarray = () => {
    if (prop.mg) {
      return prop.mg.map(function (ele) {
        return console.log("mg" + ele.id);
      });
    }
    return null;
  };

  mgarray();
  
  return (
    <div className="MG">
      {prop.mg && prop.mg.map(function (ele) {
        return (
          <div className="machinesWapper" style={{ textAlign: "center" }}>
            <h4>{ele.name}</h4>
            {ele.machines && <Machine machine={ele.machines} />}
          </div>
        );
      })}
    </div>
  );
}

export default MG;
